import React from "react";
import "./invoice.styles.css";

export const InvoiceNew = () => {
  return (
    <div className="new-invoice-container">
      <span className="invoice-header">Create New Invoice</span>

      <div className="invoice">
        <header className="invoice-header">INVOICE</header>
        <section className="business-address">
          <span>Living Skies Window Tint</span>
          <span>160C 16th Street West, Prince Albert, SK, S6V 3V3</span>
        </section>

        <label htmlFor="">Customer Name:</label>
        <input id="invoice-customer" type="text" />
      </div>
    </div>
  );
};
